import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for any "Your Profile" link (use :text-matches for robustness)
    const profileLink = await page.waitForSelector('a:text-matches("^\\s*Your Profile\\s*$", "i")', { timeout: 5000 });

    // Take screenshot before clicking
    const beforeClickShot = path.join(screenshotsDir, 'step_2_profile_link_visible.png');
    await page.screenshot({ path: beforeClickShot });
    screenshots.push(beforeClickShot);

    // Click the first visible "Your Profile" link
    await profileLink.click();

    // Wait for Jun's profile page to load by waiting for the profile header (Jun's name or profile image)
    // Use a selector unique to the profile page: .profile-header or Jun's full name
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot after navigation
    const afterNavShot = path.join(screenshotsDir, 'step_3_profile_page.png');
    await page.screenshot({ path: afterNavShot });
    screenshots.push(afterNavShot);

    // Extract Jun's profile name and username for verification
    const fullName = await page.$eval('.profile-header .profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.profile-header .profile-info .username', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile header",
      extractedData: {
        fullName,
        username
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
